import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./Login";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/student-dashboard" element={<h1>Học viên Dashboard</h1>} />
        <Route path="/teacher-dashboard" element={<h1>Giáo viên Dashboard</h1>} />
        <Route path="/manager-dashboard" element={<h1>Quản lý Dashboard</h1>} />
        <Route path="/admin-dashboard" element={<h1>Admin Dashboard</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
